import React from 'react';
import muteIcon from '../images/mute.png';
import soundOnIcon from '../images/soundOn.png';
import helpIcon from '../images/help.png';
import timerBg from '../images/timer.png';
import scoreBg from '../images/score.png';
import BoardImg from '../images/Board.png';
import GoatImg from '../images/Goat.png';
import TigerImg from '../images/Tiger.png';
import EmptyImg from '../images/Empty.png';

const BOX_WIDTH = 162;
const BOX_HEIGHT = 52;
const BOARD_WIDTH = 500;
const BOARD_HEIGHT = 400;
const BOARD_PADDING = 10;

const BoardBackground = ({
  onMuteClick,
  onHelpClick,
  isMuted,
  timerValue,
  winChanceValue,
  timerCritical,
  gameState,
  selectedId,
  lastMoveTo,
  handleUserClick,
  PIECE_SIZE,
  FIXED_POSITIONS,
  isComputerThinking,
}) => {
  const frameX = 246.569;
  const frameY = 7.61;
  const frameW = BOARD_WIDTH + BOARD_PADDING * 2;
  const frameH = BOARD_HEIGHT + BOARD_PADDING * 2;

  const detailsX = -158.55;
  const detailsY = 26.913;
  const detailsW = 328.488;
  const detailsH = 349.958;

  return (
    <svg
      xmlns="http://www.w3.org/2000/svg"
      viewBox="-300.049 -132.871 1097.609 599.878"
      style={{ width: '100vw', height: '100vh', position: 'absolute', top: 0, left: 0, zIndex: 0, backgroundSize: 'cover' }}
    > 
    <image
href="data:image/png;base64,"
width="1100" height="600" x="-301.1245198057395" y="-132.5526652914786">
<title>image (1)</title>
</image>
      {/* Background wood pattern and filters */}
      <defs>
        <pattern id="wood-pattern" patternUnits="userSpaceOnUse" width="100" height="100">
          <image
            href="https://www.transparenttextures.com/patterns/wood-pattern.png"
            x="0"
            y="0"
            width="100"
            height="100"
             preserveAspectRatio="xMidYMid slice"
          />
        </pattern>
        <linearGradient id="gold-gradient" x1="0" y1="0" x2="1" y2="1">
          <stop offset="0%" stopColor="#f8e7c1" />
          <stop offset="100%" stopColor="#c19a6b" />
        </linearGradient>
        <filter id="board-shadow" x="-50%" y="-50%" width="200%" height="200%">
          <feDropShadow dx="0" dy="8" stdDeviation="10" floodColor="rgba(0,0,0,0.5)" />
        </filter>
        <filter id="panel-shadow" x="-50%" y="-50%" width="200%" height="200%">
          <feDropShadow dx="0" dy="6" stdDeviation="8" floodColor="rgba(80,50,20,0.18)" />
        </filter>
      </defs>

      {/* Timer */}
      <image href={timerBg} x={112.436} y={-120.58} width={BOX_WIDTH} height={BOX_HEIGHT} />
      <text
        x={72.436 + BOX_WIDTH - 32}
        y={-125.58 + BOX_HEIGHT / 2 + 8}
        fontSize="22"
        fontWeight="700"
        fill={timerCritical ? '#ff6b6b' : '#222'}
        textAnchor="end"
        alignmentBaseline="middle"
      >
        {timerValue}
      </text>

      {/* Win chance */}
      <image href={scoreBg} x={298.539} y={-120.7} width={BOX_WIDTH} height={BOX_HEIGHT} />
      <text
        x={340.539 + 32}
        y={-125.7 + BOX_HEIGHT / 2 + 8}
        fontSize="22"
        fontWeight="700"
        fill='#222'
        textAnchor="start"
        alignmentBaseline="middle"
      >
        {winChanceValue}%
      </text>

      {/* Mute + Help */}
      <g style={{ cursor: 'pointer' }} onClick={onMuteClick} transform="translate(664.018,-118.089)">
        <g transform="scale(0.8)">
          <image href={isMuted ? muteIcon : soundOnIcon} width="60" height="50" />
        </g>
      </g>
      <g style={{ cursor: 'pointer' }} onClick={onHelpClick} transform="translate(725.565,-118.659)">
        <g transform="scale(0.8)">
          <image href={helpIcon} width="60" height="50" />
        </g>
      </g>



      {/* Game board frame */}
      <rect
        x={frameX}
        y={frameY}
        width={frameW}
        height={frameH}
        rx="12"
        ry="12"
        fill="url(#wood-pattern)"
        stroke="#3e2f23"
        strokeWidth="14"
        filter="url(#board-shadow)"
      />

      {/* Game board image and pieces */}
      <g transform={`translate(${frameX + BOARD_PADDING}, ${frameY + BOARD_PADDING})`}>
        <image href={BoardImg} x={0} y={0} width={BOARD_WIDTH} height={BOARD_HEIGHT} preserveAspectRatio="none" />
        {gameState?.CurrentPosition.map((piece, i) => {
          const [top, left] = FIXED_POSITIONS[i];
          const className = piece === 'G' ? 'Goat' : piece === 'T' ? 'Tiger' : 'Empty';
          const isSelected = selectedId === i;
          const isLastMove = lastMoveTo === i;
          const pieceImg = className === 'Goat' ? GoatImg : className === 'Tiger' ? TigerImg : EmptyImg;

          return (
            <g key={i} onClick={() => handleUserClick(i, className)} style={{ cursor: 'pointer' }}>
              {(isSelected || isLastMove) && (
                <circle
                  cx={left + PIECE_SIZE / 2}
                  cy={top + PIECE_SIZE / 2}
                  r={PIECE_SIZE / 2 + 2}
                  fill="none"
                  stroke={isSelected ? 'yellow' : '#ffd800'}
                  strokeWidth="5"
                />
              )}
              <image href={pieceImg} x={left} y={top} width={PIECE_SIZE} height={PIECE_SIZE} />
            </g>
          );
        })}
      </g>

      {/* Details Panel (styled) */}
      <rect
        x={detailsX}
        y={detailsY}
        width={detailsW}
        height={detailsH}
        rx="18"
        fill="url(#wood-pattern)"
        // stroke="#b8860b"
        strokeWidth="4"
        filter="url(#panel-shadow)"
      />

      {gameState && (
        <g>
          {/* Turn Indicator */}
          <g>
            <rect x={detailsX + 60} y={detailsY + 20} width={200} height={120} rx={18} fill="#fffbe6" stroke="#b8860b" strokeWidth={4} />
            <image href={gameState.SideToPlay === 0 ? TigerImg : GoatImg} x={detailsX + 70} y={detailsY + 30} width={50} height={50} />
            
            <text x={detailsX + 120} y={detailsY + 65} fontSize="16" fill="#a67c2e">
              யார் ஆட்டம்?
            </text>
            <text x={detailsX + 120} y={detailsY + 95} fontSize="22" fontWeight="bold" fill="#a67c2e">
              {gameState.SideToPlay === 0 ? 'புலி' : 'ஆடு'}
            </text>
          </g>

          {/* Goat Stats */}
          <g>
            <rect x={detailsX + 30} y={detailsY + 160} width={120} height={120} rx={18} fill="#fffbe6" stroke="#b8860b" strokeWidth={4} />
            <image href={GoatImg} x={detailsX + 60} y={detailsY + 180} width={50} height={50} />
            <text x={detailsX + 90} y={detailsY + 250} fontSize="20" fontWeight="bold" fill="#7c5a1a" textAnchor="middle">
              {gameState.OutsideGoats}
            </text>
            <text x={detailsX + 90} y={detailsY + 265} fontSize="14" fill="#a67c2e" textAnchor="middle">
              கொட்டில்
            </text>

            <rect x={detailsX + 178} y={detailsY + 160} width={120} height={120} rx={18} fill="#fffbe6" stroke="#b8860b" strokeWidth={4} />
            <image
              href={GoatImg}
              x={detailsX + 208}
              y={detailsY + 180}
              width={50}
              height={50}
              style={{ filter: 'grayscale(100%) brightness(0.7)' }}
            />
            <text x={detailsX + 235} y={detailsY + 250} fontSize="20" fontWeight="bold" fill="#7c5a1a" textAnchor="middle">
              {gameState.CapturedGoats}
            </text>
            <text x={detailsX + 238} y={detailsY + 265} fontSize="14" fill="#a67c2e" textAnchor="middle">
              பிடிபட்டவை 
            </text>
          </g>

          {/* Thinking Animation */}
          {isComputerThinking && (
            <g>
              <circle cx={detailsX + detailsW / 2 - 20} cy={detailsY + 320} r={8} fill="#4CAF50" opacity="0.8">
                <animate attributeName="opacity" values="0.8;0.3;0.8" dur="1.4s" repeatCount="indefinite" />
              </circle>
              <circle cx={detailsX + detailsW / 2} cy={detailsY + 320} r={8} fill="#4CAF50" opacity="0.8">
                <animate attributeName="opacity" values="0.3;0.8;0.3" dur="1.4s" repeatCount="indefinite" />
              </circle>
              <circle cx={detailsX + detailsW / 2 + 20} cy={detailsY + 320} r={8} fill="#4CAF50" opacity="0.8">
                <animate attributeName="opacity" values="0.8;0.3;0.8" dur="1.4s" repeatCount="indefinite" />
              </circle>
            </g>
          )}
        </g>
      )}
    </svg>
  );
};

export default BoardBackground;
